import React from "react";
import "./footer.css";
import video2 from "../../Assets/video (2)"

const Footer = () => {
  return (
    <section className="footer">
      <div className="videoDiv">
        <video src={video2} muted autoPlay loop type="video/mp4"></video>
      </div>
    </section>
  );
};

export default Footer;
